import '../../styles/App.css';

function App() {
    return (
      <div className="App">
        <header className="App-header">
          <p>
            Edit <code>src/components/App/App.js</code> and save to reload.
          </p>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    );
}

export default App;
